import React from 'react';

const Navigation = () => {
    return (
        <div className="navigation">
            <ul>
                <li><a href="/home">Home</a></li>
                <li><a href="/about">About</a></li>
                <li><a href="/login">Login</a></li>
            </ul>
        </div>
    )
};

export default Navigation;
